import adapter from './adapter'

var streamsList = [];


class Streams{
	constructor(name){
		this.name = name;
	}

}


adapter.getStreams()
.then(streams => streamsList = streams.map(stream=> {
		console.log(streamsList);
    	return new Streams(stream.name);
  	}));








export default streamsList
